webpackJsonp([0x983ba840d79c],{3364:function(p,n){p.exports={data:{markdownRemark:{html:"<p><strong>🌡9℃ ☀</strong></p>\n<p>今日は家族で、神奈川県の相模湖ピクニックランドに行きました。</p>\n<p>「着いたらお昼ご飯にしよう」</p>\n<p>僕は道中そう言いましたが、案外早く着いてしまったので、迷路のある方へ向かいました。\n途中、滑り台があったので少々寄り道をしてから、迷路を攻略しました。</p>\n<p>そして、坂の上にある建物まで家族全員で競走をしました。\n弟が一着で、僕が二着でした。</p>\n<p>建物の向こうにゴーカートを見つけましたが、短いコースで少々拍子抜けしました。</p>\n<p>ここで昼食を挟み、両親が食べ終わるまでトランポリンで暇をつぶしました。</p>\n<p>午後は F1 カートで遊びました。\nこちらは 3km ものコースで、なかなかのボリュームです。</p>\n<p>しかし、僕は運転がうまくないので、最下位になってしまいました。\n悔しかったです。</p>\n<p>最後にリフトで高台の頂上へ向かい、そこでお菓子を食べて帰りました。</p>\n<p>車でお菓子の残りを食べながらこの日記を書いていますが、今日は良い思い出となりそうです。</p>",frontmatter:{cover:null,date:"1991-03-03T21:00:00+09:00",strDate:"1991/3/3",title:"日記"}}},pathContext:{path:"/ja/blog/1991/03/03-diary/",langKey:"ja"}}}});
